import React from "react";

class ViewRegisteredStudentProfile extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      profile: this.props.location.state.profile
    };
    console.log(this.state.profile.studentfullname);
  }
  render() {
    return (
      <div>
        <div className="container">
          <h2> {this.state.profile.studentfullname}</h2>
        </div>
        <div className="container">
          {" "}
          <h2>BasicDetails</h2>
          <div class="row">
            <div class="col-25">Description :</div>
            <div class="col-75">{this.state.description || ""}</div>
          </div>
        </div>
      </div>
    );
  }
}

export default ViewRegisteredStudentProfile;
